const Layout = (props) => {
  const nave = () => (
    <ul className="nav">
      <li className="nav-item">
        <a className="nav-link" href="">
          HOME
        </a>
      </li>
      <li className="nav-item">
        <a className="nav-link" href="">
          Login
        </a>
      </li>
      <li className="nav-item">
        <a className="nav-link" href="">
          Register
        </a>
      </li>
    </ul>
  );

  return <React.Fragment>{nave()} {props.children}</React.Fragment>;
};

export default Layout;
